import React, {useEffect} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {useLocation} from "wouter";
import InfantButton from "./InfantButton";
import VistaMenu from "./VistaMenus";

export default function HomePageAdmin () {
    const [, navigate] =useLocation();

    const handleclick = (e) =>{
        e.preventDefault();
        navigate('/Registre')
    }
    const handleclick2 = (e) =>{
        e.preventDefault();
        navigate('/RegistreInfant')
    }

    return(
            <div className="service">
                <div className="col">
                    <InfantButton name={"Afegir Infant"} onClick={handleclick2}/>
                </div>
                <div className="col-md-12">
                    <div className="section-heading">
                        <h3>Menus</h3>
                        <ul className="lista-tiquets">
                            <li>Selecciona la data per veure els men√∫s del dia.</li>
                        </ul>
                    </div>
                </div>
                <div className="col-md-12">
                    {VistaMenu()}
                </div>
            </div>

    );
}
